import { create } from 'zustand';
import { persist } from 'zustand/middleware';

// Main application store with Zustand
export const useStore = create(
  persist(
    (set, get) => ({
      // User & Auth State
      user: null,
      role: 'owner', // 'owner', 'staff', 'guest'
      isAuthenticated: false,

      // Language
      lang: 'he',
      setLang: (lang) => set({ lang }),

      // UI State
      sidebarOpen: true,
      mayaChatOpen: false,
      notificationsPanelOpen: false,

      toggleSidebar: () => set((state) => ({ sidebarOpen: !state.sidebarOpen })),
      toggleMayaChat: () => set((state) => ({ mayaChatOpen: !state.mayaChatOpen })),
      toggleNotifications: () => set((state) => ({ notificationsPanelOpen: !state.notificationsPanelOpen })),

      // Real-time Notifications
      notifications: [],
      unreadCount: 0,

      addNotification: (notification) => set((state) => ({
        notifications: [
          {
            id: Date.now(),
            timestamp: new Date().toISOString(),
            read: false,
            ...notification,
          },
          ...state.notifications,
        ].slice(0, 100), // Keep last 100 notifications
        unreadCount: state.unreadCount + 1,
      })),

      markNotificationRead: (id) => set((state) => ({
        notifications: state.notifications.map((n) =>
          n.id === id ? { ...n, read: true } : n
        ),
        unreadCount: Math.max(0, state.unreadCount - 1),
      })),

      clearNotifications: () => set({ notifications: [], unreadCount: 0 }),

      // Agents State
      agents: {
        scraper: { status: 'online', lastAction: null, taskCount: 0, leadsFound: 0 },
        marketing: { status: 'online', lastAction: null, taskCount: 0, postsCreated: 0 },
        creative: { status: 'online', lastAction: null, taskCount: 0, assetsCreated: 0 },
        sales: { status: 'busy', lastAction: null, taskCount: 0, dealsInProgress: 0 },
        operations: { status: 'online', lastAction: null, taskCount: 0, messagessSent: 0 },
      },

      updateAgentStatus: (agentId, updates) => set((state) => ({
        agents: {
          ...state.agents,
          [agentId]: { ...state.agents[agentId], ...updates },
        },
      })),

      // Maya Chat State
      mayaMessages: [
        {
          id: 1,
          role: 'assistant',
          content: 'שלום! אני Maya, מנהלת הפרויקט הדיגיטלית שלך. איך אוכל לעזור לך היום?',
          timestamp: new Date().toISOString(),
        },
      ],
      mayaIsTyping: false,

      addMayaMessage: (message) => set((state) => ({
        mayaMessages: [
          ...state.mayaMessages,
          {
            id: Date.now(),
            timestamp: new Date().toISOString(),
            ...message,
          },
        ],
      })),

      setMayaTyping: (isTyping) => set({ mayaIsTyping: isTyping }),

      // Leads CRM State
      leads: [],
      leadsFilter: 'all', // 'all', 'new', 'contacted', 'qualified', 'converted', 'lost'

      addLead: (lead) => set((state) => ({
        leads: [
          {
            id: Date.now(),
            createdAt: new Date().toISOString(),
            status: 'new',
            source: 'airbnb',
            ...lead,
          },
          ...state.leads,
        ],
      })),

      updateLead: (id, updates) => set((state) => ({
        leads: state.leads.map((lead) =>
          lead.id === id ? { ...lead, ...updates } : lead
        ),
      })),

      setLeadsFilter: (filter) => set({ leadsFilter: filter }),

      // Dashboard Stats
      stats: {
        revenue: { today: 12500, week: 87500, month: 350000, trend: 12.5 },
        occupancy: { current: 87, average: 82, trend: 5.2 },
        bookings: { today: 8, week: 45, month: 180, trend: 8.3 },
        savings: { today: 2400, week: 16800, month: 67200, automationRate: 82 },
        agents: { activeTasksTotal: 24, completedToday: 156 },
      },

      updateStats: (updates) => set((state) => ({
        stats: { ...state.stats, ...updates },
      })),

      // Rooms State
      rooms: [
        { id: 101, name: 'סוויטה מלכותית', status: 'occupied', guest: 'David Cohen', checkOut: '2026-01-28', image: 'https://images.unsplash.com/photo-1631049307264-da0ec9d70304?w=400' },
        { id: 102, name: 'סוויטת אוקיינוס', status: 'available', guest: null, checkOut: null, image: 'https://images.unsplash.com/photo-1590490360182-c33d57733427?w=400' },
        { id: 103, name: 'סוויטת יהלום', status: 'cleaning', guest: null, checkOut: null, image: 'https://images.unsplash.com/photo-1582719478250-c89cae4dc85b?w=400' },
        { id: 104, name: 'סוויטת השקיעה', status: 'occupied', guest: 'Sarah Miller', checkOut: '2026-01-30', image: 'https://images.unsplash.com/photo-1566665797739-1674de7a421a?w=400' },
        { id: 201, name: 'פנטהאוז VIP', status: 'maintenance', guest: null, checkOut: null, image: 'https://images.unsplash.com/photo-1578683010236-d716f9a3f461?w=400' },
        { id: 202, name: 'סוויטה מודרנית', status: 'occupied', guest: 'John Smith', checkOut: '2026-01-26', image: 'https://images.unsplash.com/photo-1611892440504-42a792e24d32?w=400' },
      ],

      updateRoom: (id, updates) => set((state) => ({
        rooms: state.rooms.map((room) =>
          room.id === id ? { ...room, ...updates } : room
        ),
      })),

      // Daily Report State
      dailyReport: null,
      isGeneratingReport: false,

      setDailyReport: (report) => set({ dailyReport: report }),
      setGeneratingReport: (isGenerating) => set({ isGeneratingReport: isGenerating }),
    }),
    {
      name: 'hotel-enterprise-storage',
      partialize: (state) => ({
        lang: state.lang,
        role: state.role,
        sidebarOpen: state.sidebarOpen,
      }),
    }
  )
);

export default useStore;
